import React from 'react';
import './App.css';
import { Search, CurrentWeather, ForecastWeather, Footer } from './components/index';

const handleSearchChange = () => {}

function App() {
  return (
    <div className="App">
      <Search textPlaceholder="Search for a place..." onSearchChange={handleSearchChange} />
      <CurrentWeather />
      <ForecastWeather />
      <Footer />
    </div>
  );
}

export default App;
